import React from 'react';
import UsersView from './UserView';
imp

const UserList = ({ allUsers, handleUserSelection, history }) => (
  <Backdrop>
    <ModalWindow>
      <ReturnBtn>Go Back</ReturnBtn>

      <ul>
        {allUsers &&
          allUsers.map(user => (
            <li key={user.name}>
              <UsersView key={user.id} user={user} onClick={() => handleUserSelection(user.name)} />
            </li>
          ))}
      </ul>
    </ModalWindow>
  </Backdrop>
);

export default UserList;
